import './App.css';
import React from 'react'
import {useState} from 'react'

function App() {
  const [num,setNum]=useState(0);
  return (
    <div className="App">
      <button onClick={()=>setNum(num-1)}>-</button>
      <div>{num}</div>
      <button onClick={()=>setNum(num+1)}>+</button>
    </div>
  );
}

export default App;
